CREATE TABLE TEM_TAPACANTO (Cod_Rapido int,Ean13 varchar(255),largo decimal(18, 4),ancho decimal(18,4),alto decimal(18,4),peso decimal(18, 4) ,Id_Empaque int);


SELECT * FROM TEM_TAPACANTO 

--DROP TABLE TEM_TAPACANTO

		SELECT PE.Cod_Producto,
			   TT.Id_Empaque,
			   PE.Cod_Proveedor,
			   P.COD_SUCURSAL,
			   ISNULL(TT.largo,0) As Largo,
			   ISNULL(TT.alto,0) As Alto,
			   ISNULL(TT.ancho,0) As Ancho,
			   0,
			   ISNULL(TT.peso,0) As Peso,
			   null,
			   null,
			   null,
			   null,
			   GETDATE(),
			   GETDATE(),
			   NULL
			    FROM TEM_TAPACANTO TT
				 INNER JOIN Prd_ProveedoresEan PE ON TT.Ean13 = PE.Codigo_Ean
			     INNER JOIN SAV.dbo.PRD_PROVEEDORES P  ON P.COD_PRODUCTO = PE.COD_PRODUCTO
				  
					

